CREATE TABLE IF NOT EXISTS `track_artworks` (
`id` INT NULL,
`place_id` INT NULL,
`artwork_name` VARCHAR(MAX) NULL,
`artist` VARCHAR(MAX) NULL,
`type` VARCHAR(MAX) NULL,
`breed` VARCHAR(MAX) NULL,
`inspiration` VARCHAR(MAX) NULL,
`critique` VARCHAR(MAX) NULL,
`date_create` VARCHAR(MAX) NULL,
`date_disappear` VARCHAR(MAX) NULL,
`img` VARCHAR(MAX) NULL
);

